import 'package:sqflite/sqflite.dart';
import 'package:ycmovie/models/movie_list.data.dart';
import 'database_connection.dart';

class Repository {
  final _databaseConnection;

  Repository() : _databaseConnection = new DatabaseConnection();

  static Database? _database;

  Future<Database> get database async =>
      _database ??= await _databaseConnection.setDatabase();

  insertData(table, data) async {
    var connection = await database;
    return await connection.insert(table, data);
  }

  readData(table) async {
    var connection = await database;
    return await connection.query(table);
  }

  readDataById(table, itemId) async {
    var connection = await database;
    return await connection.query(table, where: 'id=?', whereArgs: [itemId]);
  }

  updateData(table, data) async {
    var connection = await database;
    return await connection
        .update(table, data, where: 'id=?', whereArgs: [data['id']]);
  }

  deleteData(table, movieId) async {
    var connection = await database;
    return await connection.rawDelete('DELETE FROM $table WHERE id = $movieId');
  }

  delDatas(table) async {
    var connection = await database;
    return await connection.execute('DELETE FROM $table');
  }

  fakemock(table) async {
    var _list = new MovieList();
    _list.moviename = 'yotube';
    _list.directorname = 'google';
    _list.posterimage =
        '''''';
    var data = _list.movieListMap();
    var connection = await database;
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    connection.insert(table, data);
    return await connection.insert(table, data);
  }
}
